import React from 'react';
import Gallery from './Gallery'; // Import the Gallery component

const MyComponent = () => {
  const images = [
    { src: 'img1.jpeg', alt: 'Image 1' },
    { src: 'img1.jpeg', alt: 'Image 1' },
    { src: 'img1.jpeg', alt: 'Image 1' },
    // Add more image objects as needed
  ];

  return <Gallery images={images} />;
};

export default MyComponent;
